import React from 'react'
import brand1 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/All brands.png';

import './Brands.css';

 const Brands = () => {
  return (
   <div className='mx-[8.5em]'>
    <div className='brands my-20'>
        <h1 className='brands-heading font-medium font-cairo text-center' >Brands we helped Grow</h1>
    </div>
    <div className='brands-container '>
      <img src={brand1} alt="" />

    </div>
    </div>
   
  )
}

export default Brands;
